import Link from 'next/link';

const linkStyle = {
    marginLeft: 15,
    padding: 20,
    border: '1px solid #DDD'
};

const Header = () => (
    <div>
        <Link href='/'>
            <a style={linkStyle}>Home</a>
        </Link>
        <Link href='/about'>
            <a style={linkStyle}>About</a>
        </Link>
    </div>
);

export default Header;
